/*Table structure for table `li_manzeng` */

DROP TABLE IF EXISTS `li_manzeng`;

CREATE TABLE `li_manzeng` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `good_id` int(11) NOT NULL COMMENT '商品ID',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '标题',
  `store` int(11) NOT NULL DEFAULT '0' COMMENT '库存',
  `price` int(11) NOT NULL DEFAULT '0' COMMENT '满多少',
  `starttime` timestamp NULL DEFAULT NULL COMMENT '开始时间',
  `endtime` timestamp NULL DEFAULT NULL COMMENT '结束时间',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态：1正常，0结束',
  `del` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除状态：1正常，0删除',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

